import React from 'react';

const UtilisateursAddPage = () => {
    return (
        <div>
            <h1>Ajouter un utilisateur</h1>

            <div class="utilisateurs-add-container">
                <div class="utilisateurs-list">
                </div>
            </div>
        </div>
    );
};

export default UtilisateursAddPage;
